    address burrowBridge;
    address burrowPart;

    constructor(MethBridge _bridgeAtHome, address _burrowBridge, address _contract) public {

        methBridge = _bridgeAtHome;
        burrowBridge = _burrowBridge;
        burrowPart = _contract;
    }

    function depositClearanceOnForeign(address _depostRecipient) public {
        require(_depostRecipient != address(0), "Address is null");

        // bytes4 methodSelector = "ForeignBridge(0).withdrawFromDeposit.selector";
        bytes4 methodSelector = 0x8fe94fb2; // TODO: получить 4 байта сигнатуры у методов контракта в Burrow

        bytes memory encodedData = abi.encodeWithSelector(methodSelector, _depostRecipient);
        methBridge.requireToPassMessage(burrowBridge, encodedData);
    }

    function setValueOnForeign(uint256 _i) public {

        // bytes4 methodSelector = "ContractOnForeign(0).setValue.selector";
        bytes4 methodSelector = 0x8fe94fb2; // TODO: получить 4 байта сигнатуры у методов контракта в Burrow

        bytes memory encodedData = abi.encodeWithSelector(methodSelector, _i);
        methBridge.requireToPassMessage(burrowPart, encodedData);
    }

